export default (state = '', action) => {
  switch (action.type) {
    
    case 'INDEX_ME':
      
      

      return Object.keys(action.payload).forEach( (me) => {

        console.log(action.payload, action.payload[0]);
      
      });

    default:
      return state;
  }
}
